import React from "react";

const Tip = ({ tipcars }) => {
  console.log("tipcars:", tipcars); // Log the entire tipcars array

  if (!Array.isArray(tipcars)) {
    return <div>No tips available</div>;
  }

  return (
    <div>
        <p>{tipcars.nametip}</p>
    </div>
  );
};

export default Tip;
